import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';
import { AppRoutingModule } from './app-routing.module'; // ✅ Doit être importé
import { AppComponent } from './app.component';

import { AccueilComponent } from './components/utlisateur/accueil/accueil.component';
import { AdminContenerComponent } from './components/admin/admin-contener/admin-contener.component';

@NgModule({
  declarations: [
    AppComponent,
    AccueilComponent,
    AdminContenerComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule // ✅ Import du module de routing
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
